<?php

namespace App\Helpers;

use GuzzleHttp;

/**
 *  Classe reponsável pela conexão da api VScore
 *
 *  - Consultar a chance de match biometrico no processod e emissão do certificado digital
 */

class VALIDScore
{
    public static function consultar_vscore(string $cpf)
    {
        $client = new GuzzleHttp\Client();

        $headers = [

            'ContractUuid' => '108c3630-b24d-48b0-b65f-efff9f1dc516',

            'Authorization' => 'Bearer '. self::generate_token(),

            'Content-Type' => 'application/json'

        ];

        $body = '{

          "cpf": "'.$cpf.'",
          "biometricImage": {
            "face": "'.self::get_image_base64().'"
          }

        }';

        $request = new GuzzleHttp\Psr7\Request('POST', 'https://api.valid.com/vscore/v3/subject', $headers, $body);

        $res = $client->sendAsync($request)->wait();

        return [
            'enviado' => $body,
            'response' => json_decode($res->getBody(), true)
        ];
    }

    public static function consultar_dvalid(string $cpf)
    {
        $client = new GuzzleHttp\Client();

        $headers = [

            'ContractUuid' => '108c3630-b24d-48b0-b65f-efff9f1dc516',

            'Authorization' => 'Bearer '. self::generate_token(),

            'Content-Type' => 'application/json'

        ];

        $body = '{

          "cpf": "'.$cpf.'",
          "biometricImage": {
            "face": "'.self::get_image_base64().'"
          }

        }';

        $request = new GuzzleHttp\Psr7\Request('POST', 'https://api.valid.com/vscore/v3/subject', $headers, $body);

        $res = $client->sendAsync($request)->wait();

        return [
            'enviado' => $body,
            'response' => json_decode($res->getBody(), true)
        ];
    }

    public static function consultar_status($transaction)
    {
        $client = new GuzzleHttp\Client();

        $headers = [

            'ContractUuid' => '108c3630-b24d-48b0-b65f-efff9f1dc516',

            'Authorization' => 'Bearer '. self::generate_token()

        ];

        $body = '';

        $request = new GuzzleHttp\Psr7\Request('GET', 'https://api.valid.com/vscore/v3/status/'.$transaction, $headers, $body);

        $res = $client->sendAsync($request)->wait();

        return json_decode($res->getBody(), true);
    }

    public static function generate_token()
    {
        $guzzle = new GuzzleHttp\Client;


        $credentials = base64_encode('Fjyh5XTPKPx2FYOcXCiQOylMzAf3Xbm7RwNjatb4s5NbJvcr:oAg7nioAl3HFW49xcLcSuPEf66EHPANGb27F8FItNEqsTQch2A2WdKljclMUbLAj');

        $body = [

            'grant_type' => 'client_credentials',

            'scope' => 'VALIDID:VSCORE:OPERATION:READ',

        ];

        $response = $guzzle->post('https://api.valid.com/oauth/client_credential/accesstoken?grant_type=client_credentials',[

            'body' => json_encode($body),

            'headers' => [

                'authorization' => 'Basic ' . $credentials,

                'ContractUuid' => '108c3630-b24d-48b0-b65f-efff9f1dc516'

            ]

        ]);

        return json_decode((string) $response->getBody(), true)['access_token'];
    }

    public static function get_image_base64()
    {
        return "";
    }
}